import React, { Component } from 'react';
 
class Name extends Component{
  constructor(){
    super();
    this.state={
      message:"hello world"
    }
  }
  changeMessage(){
    this.setState({
      message:"Congrats !! You have just done with set state"
    })
  }
  render(){
    return(
    <>
     <h1>Hussain {this.state.message}</h1>
     <button onClick={()=>{this.setState.message}}>Click to change</button>
    </>
    )
  }
}
export default Name
